    Write-Host "3. Look for schdule tasks and other methods of persistency" -ForegroundColor Gray
}

function Get-CTFHelp {
    Write-Host "=== Squid Game CTF Challenge ===" -ForegroundColor Cyan
    Write-Host "Usage:" -ForegroundColor Yellow
    Write-Host "  .\squidgame.ps1 -install    # Install the CTF challenge" -ForegroundColor White
    Write-Host "  .\squidgame.ps1 -uninstall  # Remove the CTF challenge" -ForegroundColor White
    Write-Host "  .\squidgame.ps1 -flags      # Show what to search for" -ForegroundColor White
    Write-Host "  .\squidgame.ps1 -answers    # Show answers and removal steps" -ForegroundColor White
    Write-Host "  .\squidgame.ps1 -help       # Show this help" -ForegroundColor White
}

# Main execution
if ($args[0] -eq "-install") {
    Install-SquidGame
}
elseif ($args[0] -eq "-uninstall") {
    Uninstall-SquidGame
}
elseif ($args[0] -eq "-answers") {
    Get-Answers
}
elseif ($args[0] -eq "-flags") {
    Get-Flags
    }
elseif ($args[0] -eq "-help") {
    Get-CTFHelp
}
else {
    Get-CTFHelp
}
